import React, { useState, useEffect } from "react";
import axios from "axios";

const emails = [
  {
    name: "Shannon Ledford",
    emails: ["shannon@laveaocl.com", "spikexarger@gmail.com"],
    status: "inbox",
    time: "25 mins ago",
  },
  {
    name: "BRIX ROBERTS",
    emails: ["ErikRabra@gmail.com", "ErikRoberts@examplex.com"],
    status: "spam",
    time: "53 mins ago",
  },
  {
    name: "Rodney Jones",
    emails: ["RoaneyJD@gmail.com", "TerryJBabertse@examples.com"],
    status: "inbox",
    time: "75 mins ago",
  },
  {
    name: "Amanda Flitsch",
    emails: ["Lauren.P-e@gmail.com", "Shannon@eomples.com"],
    status: "spam",
    time: "27 mins ago",
  },
  {
    name: "Kim Woodruff",
    emails: ["ErikWoodult@gail.com"],
    status: "spam",
    time: "35 mins ago",
  },
  {
    name: "CYNDI B RICE",
    emails: ["Shannonngl@gmail.com"],
    status: "spam",
    time: "25 mins ago",
  },
];

const statusColors: Record<string, string> = {
  inbox: "bg-green-100 text-green-800",
  spam: "bg-red-100 text-red-800",
};

const DashboardPage = () => {
    const [search, setSearch] = useState("");
    const [message, setMessage] = useState<string[]>([]);
    const onSearchClick = async (e: React.MouseEvent<HTMLButtonElement>) => {
        try {
            const res = await axios.post("http://localhost:5000/api/check", {
                search
            });

            if (res.data.message) {
                setMessage((prev) => [...prev, res.data.message]);
            } else {
                // Handle when no token is returned
                alert("Invalid credentials or search result not found.");
            }

        } catch (err: unknown) {
            if (axios.isAxiosError(err)) {
                console.error("Axios error:", err.response?.data || err.message);
                alert("A server error occurred. Please try again.");
            } else {
                console.error("Unexpected error:", err);
                alert("An unknown error occurred.");
            }
        }
    };

    useEffect(() => {
        setSearch("gistangjie@outlook.com");
        }, []);

    useEffect(() => {
        console.log("Updated message:", message);
        }, [message]);
    return (
    <div className="min-h-screen bg-gray-50 p-4">
        {/* Header */}
        <div className="bg-blue-900 text-white px-6 py-4 flex justify-between items-center rounded-md">
        <h1 className="text-xl font-semibold">Email Inbox Checker</h1>
        <div className="relative flex-row w-1/3">
            <input
            type="text"
            placeholder="Enter keyword or email and press enter"
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="w-full pl-4 pr-10 py-2 rounded-md text-black"
            />
            <span className="absolute right-2 top-2.5 text-green-600">
            üîç
            </span>
        </div>
        <button
            type="button"            
            onClick={onSearchClick}
            className="bg-blue-600 text-white w-40 py-2 rounded-md hover:bg-blue-700 transition"
        > Check
        </button>
        </div>

        {/* Stats */}
        <div className="flex gap-8 mt-10 mb-6">
            <div className="text-center left-4 ml-4">
                <div className="w-24 h-24 rounded-full border-8 border-green-500 border-t-white mx-auto"></div>
                <p className="mt-2 font-medium text-green-600">Inbox<br />75%</p>
            </div>
            <div className="text-center">
                <div className="w-24 h-24 rounded-full border-8 border-red-500 border-t-white mx-auto"></div>
                <p className="mt-2 font-medium text-red-600">Spam<br />25%</p>
            </div>
        </div>

        <div>  
        <div className="space-y-4">
            <div className="flow-root box-border h-32 w-32 p-4 border-4">
                <div className="my-4 ...">1</div>
            </div>
            <div className="flow-root box-border h-32 w-32 p-4 border-4">
                <div className="my-4 ...">2</div>
            </div>
        </div>             
        <div className="mt-10">
            <h2 className="text-lg font-bold mb-2">Email Check Results</h2>
            {message.length === 0 ? (
                <p>No results yet.</p>
            ) : (
                <ul className="space-y-2">
                {message.map((msg, index) => (
                    <li key={index} className="p-3 bg-white rounded shadow border">
                    <pre>{JSON.stringify(msg, null, 2)}</pre>
                    </li>
                ))}
                </ul>
            )}
            </div>
        </div>
        {/* Email Results */}
        
    </div>
    );
};

export default DashboardPage;
